const netflix = require('../assets/images/netflix-logo.png');
const netflixTransparent = require('../assets/images/netflix-logo-transparent.png');
const netflixFull = require('../assets/images/netflix-logo-full.png');

const bannerBander = require('../assets/images/content/content-brand.jpg');
const logoBander = require('../assets/images/content/bandersnatch-logo.jpg');

// circle
const americanGangster = require('../assets/images/content/circle_american-gangster.png');
const breakingBad = require('../assets/images/content/circle_breaking-bad.png');
const starwarsJedi = require('../assets/images/content/circle_star-wars-the-last-jedi.png');
const guardians2 = require('../assets/images/content/circle_guardians-vol2.png');
const darkKnight = require('../assets/images/content/circle_the-dark-knight.png');
const blackPanther = require('../assets/images/content/circle_black-panther.png');

// rectangle
const peakyBlinders = require('../assets/images/content/peaky-blinders.jpg');
const goodWillHunting = require('../assets/images/content/good-will-hunting.jpg');
const johnMulaneyKG = require('../assets/images/content/john-mulaney-kid-gorgeous.jpg');
const blackmirror = require('../assets/images/content/black-mirror-bandersnatch.jpg');
const crashlanding = require('../assets/images/content/crashlanding.jpg');
const startup = require('../assets/images/content/startup.jpg');
const itaweon = require('../assets/images/content/itawom.jpg');
const kgf = require('../assets/images/content/kgf.jpg');

const mask = require('../assets/images/user-icons/mask.jpg');
const penguin = require('../assets/images/user-icons/purple-penguin.jpg');
const robot = require('../assets/images/user-icons/robot.jpg');

export default {
  netflix,
  netflixTransparent,
  netflixFull,

  bannerBander,
  logoBander,

  americanGangster,
  breakingBad,
  starwarsJedi,
  guardians2,
  darkKnight,
  blackPanther,
  crashlanding,
  startup,
  itaweon,
  kgf,

  peakyBlinders,
  goodWillHunting,
  johnMulaneyKG,
  blackmirror,

  mask,
  penguin,
  robot
};
